MongoDB get remaining seats of restaurant<p>I've problem to find remaining seats of particular restaurant in a particular <code>Date range</code></p>

<p>Let me define my problem. Suppose I've a collection it called <code>booking</code></p>

<p>In this have a following fields:</p>

<ul>
<li>Booking ID</li>
<li>User ID</li>
<li>Restaurant ID</li>
<li>Booking Start Date (date saved in Timestamp)</li>
<li>Booking End Date (date saved in Timestamp)</li>
<li>Booked Seat</li>
</ul>

<p><a href="https://i.stack.imgur.com/oDn3m.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/oDn3m.png" alt="enter image description here"></a></p>

<p>If there are <strong><em>50</em></strong> seats in restaurant. And I want to check available seats of a particular date range for example the date range is <strong><em><code>6-12</code></em></strong>(This range in timestamp)"(Start Date) - (End Date)" </p>

<p>How to calculate the total remaining seats of restaurant.</p>

<p>If anyone have any idea please let me know.</p>

<p>Thanks in advance</p>

<p>Code is here</p>

<pre><code>const where = {};
where.restaurant_id = 126;
where.user_id = 1;
where.start_date = { $gte: 6 };
where.end_date = { $gte: 12 };
const remainingSeats = getSeatsAvailability(where);

function getSeatsAvailability(where) {
  return new Promise((resolve, reject) =&gt; {
    bookingModel.find(where, (err, details) =&gt; {
      if (err) { reject(err); } else { resolve(details); }
    });
  });
}
</code></pre>

