        global $var; 
        return $collection-&gt;aggregate([
                ['$lookup' =&gt; [
                    'from' =&gt; "{$var}_specifications",
                    'localField' =&gt; 'specifications_id',
                    'foreignField' =&gt; '_id',
                    'as' =&gt; 'specifications'
                ]]
            ]);
        });
</code></pre>

<p>I found only an example for an ordinary SQL (<a href="https://fideloper.com/laravel-raw-queries" rel="nofollow noreferrer">https://fideloper.com/laravel-raw-queries</a>)</p>

